import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from "./components/Header";
import Home from './components/Home/Home';
import Jaipur from './components/Jaipur/Jaipur';
import Mumbai from './components/Mumbai/Mumbai';
import Goa from './components/Goa/Goa';

const LazyJaipur = React.lazy(()=> import('./components/Jaipur/Jaipur'));

function App() {
  return (
    <div className="App">
      <Router>
      <Header/>
        <React.Suspense fallback={React.Spinner}>
        <Routes>
            <Route exact path="/" element={<Home />} />
            <Route exact path="/jaipur" element={<LazyJaipur/>} />
            <Route exact path="/mumbai" element={<Mumbai/>} />
            <Route exact path="/goa" element={<Goa/>} />

        </Routes>
        </React.Suspense>
      </Router>
    </div>
  );
}
export default App;
